import React from "react";
import CardList from "./cardList";
import {robots} from "./robots";
import SearchBox from "./search_box";

import "./app.css";



const state = {
	robots: robots,
	searchfield: ""
}
const App = (props) => {
	return (
		<div id="wrapper">
			<div id="search">
				<h1> Robo-Friends </h1>
				<SearchBox />
			</div>
			<CardList robots={robots}/>
		</div>
	);
}

export default App;
